package org.minima.system.network.minidapps.minihub.hexdata;

import java.io.ByteArrayOutputStream;
import java.io.IOException;

import org.minima.objects.base.MiniData;

public class helphtml {
	//FILE SIZE 1906
	//HEX NUM 2
	public final static int HEXNUM = 2;
	public final static byte[][] HEXDATA = new byte[2][];
	public static byte[] FINAL_ARRAY = null;
	static {
	//0 - 1000
	HEXDATA[0] = new MiniData("").getData();
	//1000 - 1906
	HEXDATA[1] = new MiniData("").getData();
	}

	                public static byte[] returnData() throws IOException {
	                        if(FINAL_ARRAY == null) {
	                                ByteArrayOutputStream baos = new ByteArrayOutputStream();
	                                for(int i=0;i<HEXNUM;i++) {
	                                        baos.write(HEXDATA[i]);
	                                }
	                                baos.flush();
	                                FINAL_ARRAY = baos.toByteArray();
	                        }
	                    return FINAL_ARRAY;
	                }
}
